import React from "react";
// import { GoggleButton } from 'react-google-button'
import SinginImg from '/src/images/bg_photo.jpg'

const Singin = () => {
    return(
        <div className="h-screen w-screen">
            <h1 className='flex justify-center font-bold'>Sing In</h1>

           <div>
               <img src={SinginImg} alt=""/>
           </div>

            <div>
            <form className='m-auto'>
                <input className='mx-auto flex justify-center  rounded border-2 border-black ' type="text" placeholder='Email' name='email'/>
                <input className='mx-auto flex justify-center  rounded border-2 border-black ' type="text" placeholder='Password' name='password'/>
                <button className='mx-auto flex justify-center content-center'>Submit</button>
            </form>
            </div>
        </div>
    )
}
export default Singin;
